import React from "react"
import { useState } from 'react'
import TodoList from "./TodoList.js";

function App() {

    const [todos, setTodos] = React.useState([{id: 1, name: 'Todo 1', complete: 'true'}, {id: 2, name: 'Todo 2', complete: true}])
  return (
    <>
      <h1>My To-Do List</h1>
      <TodoList todos={todos}/>
      <input type="text"></input>
      <button>Add Task</button>
      <button>Clear Task</button>
      <h5>0 tasks left</h5>
    </>
  );
}

export default App;
